-- Name: assign_random_provosts_to_halls(); Type: FUNCTION; Schema: public; Owner: system
--

CREATE FUNCTION public.assign_random_provosts_to_halls() RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    h RECORD;
    t_id INT;
BEGIN
    FOR h IN SELECT hall_id FROM Hall LOOP
        SELECT teacher_id INTO t_id
        FROM Teacher
        WHERE teacher_id NOT IN (
            SELECT teacher_id FROM Provost
        )
        ORDER BY RANDOM()
        LIMIT 1;
        VALUES (t_id, h.hall_id, CURRENT_DATE, NULL);
    END LOOP;
END;
$$;


